from typing import DefaultDict


class Tarjan:

    def __init__(self, verbose = False) -> None:
        self.verbose = verbose

    graph = DefaultDict(list)
    critical_connections = []
    visitedTimes = {}
    lowTimes = {}
    time = 0

    def get_critical_connections(self, connections):
        self.build_graph(connections)

        # WE CAN START WITH ANY NODE. SO IT CAN BE NODE 1
        self.dfs(1, -1)

        return self.critical_connections

    def dfs(self, current_node, parent_node):
        self.visitedTimes[current_node] = self.time
        self.lowTimes[current_node] = self.time

        self.time += 1
        self.printIfVerbose(f'    Visiting node {current_node}. visitTime and lowTime: {self.time}')

        for neighbor in self.graph[current_node]:
            self.printIfVerbose(f'discover neighbor: {neighbor}')
            if self.visitedTimes.get(neighbor, None) == None:
                self.dfs(neighbor, current_node)

                # THE CODE BELOW REFERS TO THE MOMENTO WHEN WE ARE BACKING AFTER GO DEEP IN GRAPH
                self.printIfVerbose(f'updating lowtimes of current node {current_node}')
                self.lowTimes[current_node] = min(self.lowTimes[current_node], self.lowTimes[neighbor])
            elif neighbor != parent_node: # BACK EDGE
                """
                This means the current node can be reach
                from another node that has already been visited
                so we update lowTime of this node with the visitedTime of the
                neighbor if it is lower.
                """
                self.lowTimes[current_node] = min(
                    self.lowTimes[current_node], self.visitedTimes[neighbor]
                )
                self.printIfVerbose(f'updating lowtimes of current node {current_node} not parent')
            else:
                self.printIfVerbose(f'ignoring neighbor {neighbor} because it is parent')

            # THAT MEANS THE ONLY WAY TO REACH THIS NEIGHBOR IS THROUGH THE CURRENT NODE
            # THIS IS BECAUSE IF THERE WAS ANOTHER WAY TO REACH THE NEIGHBOR NODE THE 
            # LOWTIME OF THAT NODE WOULD BE UPDATED (LOWER) AT THIS POINT. REMEMBER, 
            # IN DFS WE NAVIGATE IN-DEPTH TO ALL NEIGHBORS BEFORE GOING BACK.
            if self.lowTimes[neighbor] > self.visitedTimes[current_node]:
                self.printIfVerbose(f'Critical connection found ({current_node}, {neighbor})')
                self.critical_connections.append([current_node, neighbor])

    def build_graph(self, connections):

        for connection in connections:
            self.graph[connection[0]].append(connection[1])
            self.graph[connection[1]].append(connection[0])

    def printIfVerbose(self, message):
        if self.verbose:
            print(message)



